import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import logo1 from '../assets/imgs/Group 150.png';
import logo2 from '../assets/imgs/Group 151.png';
import logo3 from '../assets/imgs/Group 152.png';
import logo4 from '../assets/imgs/Group 153.png';
import logo5 from '../assets/imgs/Group 154.png';
import logo6 from '../assets/imgs/Group 155.png';
import logo7 from '../assets/imgs/Group 156.png';


function HeroSection() {

    return (
        <>
            <div className='contain-1'>
                <Container fluid="md" >
                    <Row className='row-1'>
                        <Col><img src={logo1} alt='logos' /></Col>
                        <Col><img src={logo2} alt='logos' /></Col>
                        <Col><img src={logo3} alt='logos' /></Col>
                        <Col><img src={logo4} alt='logos' /></Col>
                        <Col><img src={logo5} alt='logos' /></Col>
                        <Col><img src={logo6} alt='logos' /></Col>
                    </Row>


                    <Row>
                        <Col sm={8}>sm=8</Col>
                        <Col sm={4}>sm=4</Col>
                    </Row>
                </Container>

            </div>

        </>
    );
}

export default HeroSection;
